DROP TABLE IF EXISTS `fee_calc_mode`;
CREATE TABLE `fee_calc_mode` (
  `mid` varchar(20) NOT NULL DEFAULT '' COMMENT '商户号',
  `type` tinyint(4) DEFAULT NULL,
  `gate` int(11) NOT NULL DEFAULT '0' COMMENT '网关id 对应 ryt_gate主键',
  `calc_mode` varchar(120) DEFAULT '' COMMENT '商户手续费率',
  `base_fee` int(11) DEFAULT '500',
  `min_fee` int(11) DEFAULT '10',
  `max_fee` int(11) DEFAULT '10000',
  `calc_cond` varchar(120) DEFAULT NULL,
  `author_type` tinyint(4) DEFAULT '0',
  `state` tinyint(4) DEFAULT '0',
  `trans_mode` tinyint(4) DEFAULT '0',
  `gate_id` varchar(10) DEFAULT NULL COMMENT '来自于gates表 没用',
  `bk_fee_mode` varchar(120) DEFAULT '' COMMENT '银行手续费率',
  `gid` int(11) DEFAULT '0' COMMENT '渠道号 对应 gate_route主键',
  PRIMARY KEY (`gate`,`mid`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 CONNECTION='mysql://lightpole:123@192.168.20.173:3306/ryp1_production/fee_calc_mode';

